import { List, ListItem, ListItemText, Paper } from "@material-ui/core";

export default function OrderedFoodItem(props) {
  const { orderedFoodItems } = props;

  return (
    // List all items in OrderedFoodItem (orderDetails)
    <List>
      {orderedFoodItems.map((item, index) => (
        // <Paper key={item.foodItemId}>
        <Paper key={index}>
          <ListItem>
            <ListItemText
              primary={item.foodItemName}
              primaryTypographyProps={{
                component: "h1",
                style: {
                  fontSize: "1.2em",
                  fontWeight: "500",
                },
              }}
            ></ListItemText>
          </ListItem>
        </Paper>
      ))}
    </List>
  );
}
